import Navbar from "../components/Navbar"

const Home = () => {
  const authToken = false

  let buttonText;
  if (authToken) {
    buttonText = "Sign Out";
  } else {
    buttonText = "create account";
  }
  const handleClick =() => {
    console.log('clicked')
  }
  return (
    <div>
    <Navbar minimal={false} authToken={authToken}/>
    <div className="home">
       <h1>Swipe Right</h1>
       <button className="primary-button" onClick={handleClick}>
	  {buttonText}
       </button>
    </div>
    </div>
  )
}

export default Home
